import React from 'react';
import ReactDOM from 'react-dom';
import ArticleHeader from './components/ArticleHeader/index.js';

var data;
				
var xmlhttp = new XMLHttpRequest();
var url = "http://localhost:4502/content/lordabbett/data.json";


function createReactComponents(json) {
  
  var obj = JSON.parse(json);
		
   articleHeader=obj;
	
   //ReactDOM.render(<ImageComponent  {...articleHeader} />, document.getElementById('root'));
}


xmlhttp.onreadystatechange = function() {
  if (this.readyState == 4 && this.status == 200) {   
    createReactComponents(this.responseText);
  }
};
xmlhttp.open("GET", url, true);
xmlhttp.send();
